import React, {useState} from 'react';
import { motion } from 'framer-motion';

import Item from '../components/item';

function ItemList({id, index, href, title, subtitle}) {
  // const [open, setOpen] = useState(false);
  const [hovered, setHovered] = useState(null)

  return(
      <div id="links-box">
        <ul id="links">
          <Item id={"muse-li"} index={1} href={"https://www.musei.io"} title={"Musei"} subtitle={"A DIY virtual reality gallery builder for artists, galleries and curators"} />

          <Item id={"everything-li"} index={2} href={"https://everythingforever.net/nodes"} title={"Everything Forever Nodes"} subtitle={"An exploration interface for the Royal College of Art exhibit Everything Forever"} />

          <Item id={"froala-li"} index={3} href={"https://froala.com/wysiwyg-editor/whiteboard"} title={"Froala Whiteboard"} subtitle={"A collaborative brainstorming tool"} />

          <Item id={"froala-2-li"} index={4} href={"https://froala.com/wysiwyg-editor/pricing"} title={"Froala Pricing Wizard"} subtitle={"A guided questionnaire to help you pick the right plan"} />

          <Item id={"froala-3-li"} index={5} href={"https://froala.com/wysiwyg-editor/customizer-v3/"} title={"Froala Editor Customizer"} subtitle={"A visual tool for granular customization of the Froala WYSIWYG Editor"} />

          <Item id={"violeta-li"} index={6} href={"http://violeta-popov-demo.herokuapp.com"} title={"Violeta Popov M.D."} subtitle={"A portfolio website for an NY-based medical practitioner - \nwork in progress..."} />

          <Item id={"wedding-li"} index={7} href={"https://savethedate.jujubobo.wedding"} title={"Wedding Save the Date"} subtitle={"A save-the-date website created for a couple getting married"} />

        </ul>
      </div>
    )
}

export default ItemList;
